	createCubeObject: function(json) {
		var translate = json.translate || [0, 0, 0];
		var width = json.width;
		var height = json.height;
		var depth = json.depth;
		var sideColor = json.sideColor;
		var topColor = json.topColor;

		var cube = new mono.Cube(width, height, depth);
		cube.setPosition(translate[0], translate[1] + height / 2, translate[2]);
		cube.s({
			"m.color": sideColor,
			"m.ambient": sideColor,
			"left.m.lightmap.image": img_inside_lightmap,
			"right.m.lightmap.image": img_outside_lightmap,
			"front.m.lightmap.image": img_outside_lightmap,
			"back.m.lightmap.image": img_inside_lightmap,
			"top.m.color": topColor,
			"top.m.ambient": topColor,
			"bottom.m.color": topColor,
			"bottom.m.ambient": topColor
		});

		return cube;
	},
	createPathObject: function(json) {
		var translate = json.translate || [0, 0, 0],
			width = json.width,
			height = json.height,
			data = json.data,
			path = void 0, 
			insideColor = json.insideColor, 
			outsideColor = json.outsideColor, 
			topColor = json.topColor;

		for (var i = 0; i < data.length; i++) {
			var datum = data[i];
			if (path) {
				path.lineTo(datum[0], datum[1], 0);
			}else{
				path = new mono.Path;
				path.moveTo(datum[0], datum[1], 0);
			}
		}
		var wall = this.createWall(path, width, height, insideColor, outsideColor, topColor);
		wall.setPosition(translate[0], translate[1], -translate[2]);
		return wall;
	},
	filterJson: function(serva, objects) {
		var i = [];
		for (var r = 0; r < objects.length; r++) {
			var object = objects[r];
			var type = object.type;
			var filter = this.getFilter(type);

			if (filter) {
				var o = filter(serva, object);
				if (o) {
					if(o instanceof Array){
						i = i.concat(o);
					}else{
						this.copyProperties(object, o, ["type"]);
						i.push(o);
					}
				}
			} else {
				i.push(object);	
			} 
		}
		return i;
	},
	createCombo: function(parts) {
		var objects = [];
		var ops = [];
		var names = [];

		for (var i = 0; i < parts.length; i++) {
			var part = parts[i];
			var op = part.op || "+";
			var style = part.style;
			var translate = (part.translate || [0, 0, 0], part.rotate || [0, 0, 0]);
			var object = null;

			if("path" === part.type){
				object = this.createPathObject(part);
			}
			if("cube" === part.type){
				object = this.createCubeObject(part);
			}
			if(object){
				object.setRotation(translate[0], translate[1], translate[2]);
				if(style){
					object.s(style);
				}
				objects.push(object);
				if(objects.length > 1){
					ops.push(op);
				}
				names.push(object.getId());
			}
		}
		if (objects.length > 0) {
			var comboNode = new mono.ComboNode(objects, ops);
			comboNode.setNames(names);
			return comboNode;
		}
		return null;
	},
	loadJson: function(gl3dview, jsons) {
		var serva = gl3dview.getServa();
		var clearColor = jsons.clearColor || demo.Default.CLEAR_COLOR;
		var clearAlpha = jsons.clearAlpha || demo.Default.CLEAR_ALPHA;

		gl3dview.setClearColor(clearColor);
		gl3dview.setClearAlpha(clearAlpha);
		var shadowHost;
		var shadowHostName;
		var objects = [];
		var ops = [];
		var names = [];

		for (var i = 0; i < jsons.length; i++) {
			var json = jsons[i];
			if (!json.shadowGhost) {
				var op = json.op;
				var style = json.style;
				var client = json.client;
				var translate = (json.translate || [0, 0, 0], json.rotate || [0, 0, 0]);
				var object = null;

				if("path" === json.type){
					object = this.createPathObject(json);
				}
				if("cube" === json.type){
					object = this.createCubeObject(json);
				}
				if(json.shadowHost){
					shadowHost = object;
					shadowHostName = object.getId();
				}

				var creator = demo.Default.getCreator(json.type);
				if(creator){
					creator(serva, json);
				}else{
					if(object){
						object.setRotation(translate[0], translate[1], translate[2]);
						if(style){
							object.s(style);
						}
						if(client){
							object.c(client);
						}
						if(op){
							objects.push(object);
							if(objects.length > 1){
								ops.push(op);
							}
							names.push(object.getId())
						}else{
							serva.add(object);
						}
					}
				}
			}
		}
		if (objects.length > 0) {
			var comboNode = new mono.ComboNode(objects, ops);
			comboNode.setNames(names);
			serva.add(comboNode);

			if (shadowHost && shadowHostName) {
				var timeout = function(node, host, hostName) {
					return function() {
						(new Date).getTime()
						var shadowImage = demo.Default.createShadowImage(jsons, host.getWidth(), host.getDepth());
						var image = hostName + "-top.m.lightmap.image";
						node.setStyle(image, shadowImage);
						(new Date).getTime()
					}
				};
				setTimeout(timeout(comboNode, shadowHost, shadowHostName), demo.Default.LAZY_MAX)
			}
		}
	},
