demo.Default.registerFilter('wall', function(box, json) {
	var objects = [];

	var wall = {
		type: 'path',
		op: '+',
		width: 20,
		height: json.height,
		floorShadow: true,
		insideColor: '#B8CAD5',
		outsideColor: '#A5BDDD',
		topColor: '#D6E4EC',
		translate: json.translate,
		data: json.data,
	};
	objects.push(wall);

	if (json.children) {
		var children = demo.Default.filterJson(box, json.children);
		objects = objects.concat(children);
	}

	var comboChildren = [];
	var returnObjects = [];
	for (var i = 0; i < objects.length; i++) {
		var child = objects[i];
		if (child.op) {
			comboChildren.push(child);
		} else {
			returnObjects.push(child);
		}
	}

	box.add(demo.Default.createCombo(comboChildren));

	wall.shadowGhost = true;
	returnObjects.push(wall);
	return returnObjects;
});

